var gfx = /** @class */ (function () {
    function gfx(ctx) {
        this.myCtx = ctx;
    }
    gfx.prototype.ClearCanvas = function () {
        this.myCtx.clearRect(0, 0, this.myCtx.canvas.clientWidth, this.myCtx.canvas.clientHeight);
    };
    gfx.prototype.StartDrawing = function () {
        this.canvas_image_data = this.myCtx.getImageData(0, 0, this.myCtx.canvas.clientWidth, this.myCtx.canvas.clientHeight);
        this.canvas_image_data_pixels = this.canvas_image_data.data;
    };
    gfx.prototype.FinishDrawing = function () {
        this.myCtx.putImageData(this.canvas_image_data, 0, 0);
    };
    gfx.prototype.PutPixel = function (Pos, Color) {
        var offset = (Pos.y * this.canvas_image_data.width + Pos.x) * 4;
        this.canvas_image_data_pixels[offset + 0] = Color.x;
        this.canvas_image_data_pixels[offset + 1] = Color.y;
        this.canvas_image_data_pixels[offset + 2] = Color.z;
        this.canvas_image_data_pixels[offset + 3] = Color.w;
        /*this.myCtx.fillStyle = "rgba("+Color.x+","+Color.y+","+Color.z+","+(Color.w/255)+")";
        this.myCtx.fillRect( Pos.x, Pos.y, 1, 1 );*/
    };
    gfx.prototype.GetPixelAt = function (Pos) {
        var raw_data = this.myCtx.getImageData(Pos.x, Pos.y, 1, 1).data;
        return new Vector4(raw_data[0], raw_data[1], raw_data[2], raw_data[3]);
    };
    return gfx;
}());
/// <reference path="gfx.ts"/>
var ImageBroker = /** @class */ (function () {
    function ImageBroker(imguri, callback) {
        var _this = this;
        var img = new Image();
        img.src = imguri;
        img.onload = function () { _this.LoadImageIntoCanvas(img, callback); };
    }
    ImageBroker.prototype.LoadImageIntoCanvas = function (img, callback) {
        this.width = img.width;
        this.height = img.height;
        this.imgCanvas = document.createElement('canvas');
        this.imgCanvas.width = img.width;
        this.imgCanvas.height = img.height;
        this.imgCanvas.getContext('2d').drawImage(img, 0, 0, img.width, img.height);
        callback();
    };
    ImageBroker.prototype.GetPixelAt = function (Pos) {
        var raw_data = this.imgCanvas.getContext('2d').getImageData(Pos.x, Pos.y, 1, 1).data;
        return new Vector4(raw_data[0], raw_data[1], raw_data[2], raw_data[3]);
    };
    return ImageBroker;
}());
